import './styles.css'
import { useAuth } from 'react-oidc-context'

export default function App() {
  const auth = useAuth()
  console.log(auth.settings.extraQueryParams)

  return (
    <div className='App'>
      <h1>Hello </h1>
      <button
        onClick={() =>
          void auth.signinRedirect({
            extraQueryParams: {
              param1: 'extraparam1',
            },
          })
        }
      >
        Log in
      </button>
      <h2>Start </h2>
    </div>
  )
}
